Snappy Fax Version 4.0


Snappy Fax is our stand-alone fax software. It also doubles as the client software for the fax server, when properly configured.

Snappy Fax version 4.0 is compatible with all versions of Windows except for Windows 95, Windows 98, and Windows ME.

The download file now includes all dictionary files for Optical Character Recognition, it does not include the 135 page printable PDF manual which is available to download from the link below.

Note: Snappy Fax now includes all the functionality of Archive Manager and Remote Submit which were previously available as a separate download and available at additional cost. Those products have been retired and are no longer available. OCR functionality is now include in Snappy Fax, it no longer requires and additional payment to enable its functionality.

To use Optical Character Recognition with Snappy Fax, you will need the Transym OCR Engine, version 1.4. The OCR engine must be purchased from Transym, it is not our product. You can download the engine from Transym&amp;#039;s website. The engine will recognize about 100 pages before you will be required to purchase a license. The license for version 1.4 is $40 (price may change, check their website). The OCR engine is very accurate at recognizing text.





